  false,\n\t\"url\": null,\n\t\"notes\": \"This is a summary of 2004 freshwater mussel
  inventory on Cahaba River National Wildlife Refuge. The Cahaba River National Wildlife
  Refuge was established for the purpose of protecting and managing a unique section
  of the Cahaba River and the lands adjacent to it. Within the Refuge a series of
  bedrock shoals are extremely productive, supporting a variety of fish, mussels,
  snails, as well as a dense stand of the Cahaba lily. A recent survey of select sites
  on the Refuge, and reports by others, indicate that at least 17 species of native
  mussels continue to survive on the Refuge.\",\n\t\"license_title\": \"License Not
